Photo 58 - Paul's Mausoleum
Wishing to memorialize her husband, the Dowager Empress Maria Feodorovna decided to construct an architectural monument in his honor.
Paul's Mausoleum was built in 1810 by Jean-Francois Thomas de Thomon in New Sylvia.
The building was designed like an ancient Roman temple and has the inscription "To the Benevolent Husband" on the front side.
